//                  SERVICES PAGE AS A COMPONENT                   \\

import Home from "./Home"

// Importing Modules :
import React from 'react';

const Services = (props)=>{
    return(
        <>
            This is SERVICES Page {props.name}.
            <Home name={props.name}/>
        </>
    )
}

// Exporting Services Component :
export default Services;
